import { saveGoal } from '../../GoalsPageScripting';
import GoalStatusDropdown from '../../GoalStatusDropdown';
import ColorDropdown from '../../../ColorPickerComponent/ColorDropdown/ColorDropdown';

function EditGoalModal(props) {
    return(
        <div className="EditGoalModal">
            <div className="ModalBackground">
                <div className="ModalContainer">
                    <h1>{props.goal.name}</h1>
                    <input id="edit-goal-name-input" type="text" defaultValue={props.goal.name} />
                    <GoalStatusDropdown id="edit-goal-status-dropdown" />
                    <ColorDropdown id="edit-goal-color-dropdown" colorList={props.colors} colorId={props.goal.colorId} />
                    <button onClick={() => {saveGoal(props.goal); props.modalOpen(false);}}>Save</button>
                    <button onClick={() => props.modalOpen(false)}>Cancel</button>
                </div>
            </div>
        </div>
    );
}

export default EditGoalModal;
